import React from "react";
import './index.css';
import {
    BrowserRouter as Router,
    Link
} from "react-router-dom";

function HPNavBar(){
    return(

        <Router>
            <div className="navBar" id="homePageNB">
            <ul id="hpURLList">
                <li>Virtual Version</li>
                <li className="nvUpperRightOptions"><Link href="https://google.com/"><button>Log in</button></Link></li>
                <li className="nvUpperRightOptions"><Link href="https://facebook.com/"><button>Sign up</button></Link></li>
            </ul>
        </div>
        </Router>
    );
}

export default HPNavBar;
